import React, { Component } from 'react'
import { withRouter} from 'react-router-dom'
import Fab from '@material-ui/core/Fab';
import Icon from '@material-ui/core/Icon';
import Grid from '@material-ui/core/Grid';
import ReactDOM from 'react-dom';
import { getRestaurants } from './DataManipulation'


class RestaurantsList extends Component {

    componentDidMount() {
        this.props.getRestaurants();
      }


    render () {
        const { items } = this.props.item;
        return (

<div id="sisa" className="items">
    <Grid container spacing={12}>
        <Grid item xs={10}>
              Čaršijska Česma
            </Grid>
            <Grid item xs={2}>
                <Fab color="primary"size="small" flex-end onClick={ this.toggleDiv } onClick={this.creatediv}>
                    <Icon>add_icon</Icon>
                </Fab>
        </Grid>
        
            
    </Grid>
    </div>
        )
    }

    creatediv(){
        
        const element = (
            
            <div>
              <h1>Hello, world!</h1>
              <h2>It is {new Date().toLocaleTimeString()}.</h2>
            </div>
          );
          ReactDOM.render(element, document.getElementById('panels'));
        }

}


export default withRouter(RestaurantsList)
